import React from 'react';
import { makeStyles } from '@material-ui/core/styles';
import AppBar from '@material-ui/core/AppBar';
import Toolbar from '@material-ui/core/Toolbar';
import Typography from '@material-ui/core/Typography';
import Button from '@material-ui/core/Button';
import IconButton from '@material-ui/core/IconButton';
import MenuIcon from '@material-ui/icons/Menu';
import Grid from '@material-ui/core/Grid';


const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  menuButton: {
    marginRight: theme.spacing(2),
  },
  title: {
    flexGrow: 1,
  },
}));

function Home(){
	const classes = useStyles();

	return(	
       <div>
			<header className="MuiPaper-root MuiAppBar-root MuiAppBar-positionAbsolute MuiAppBar-colorPrimary jss4 MuiPaper-elevation4"><div class="MuiToolbar-root MuiToolbar-regular jss2 MuiToolbar-gutters"><button class="MuiButtonBase-root MuiIconButton-root jss6 MuiIconButton-colorInherit MuiIconButton-edgeStart" tabindex="0" type="button" aria-label="open drawer"><span class="MuiIconButton-label"><svg class="MuiSvgIcon-root" focusable="false" viewBox="0 0 24 24" aria-hidden="true"><path d="M3 18h18v-2H3v2zm0-5h18v-2H3v2zm0-7v2h18V6H3z"></path></svg></span><span class="MuiTouchRipple-root"></span></button><h1 class="MuiTypography-root jss8 MuiTypography-h6 MuiTypography-colorInherit MuiTypography-noWrap">Dashboard</h1><button class="MuiButtonBase-root MuiIconButton-root MuiIconButton-colorInherit" tabindex="0" type="button"><span class="MuiIconButton-label"><span class="MuiBadge-root"><svg class="MuiSvgIcon-root" focusable="false" viewBox="0 0 24 24" aria-hidden="true"><path d="M12 22c1.1 0 2-.9 2-2h-4c0 1.1.89 2 2 2zm6-6v-5c0-3.07-1.64-5.64-4.5-6.32V4c0-.83-.67-1.5-1.5-1.5s-1.5.67-1.5 1.5v.68C7.63 5.36 6 7.92 6 11v5l-2 2v1h16v-1l-2-2z"></path></svg><span class="MuiBadge-badge MuiBadge-anchorOriginTopRightRectangle MuiBadge-colorSecondary">4</span></span></span><span class="MuiTouchRipple-root"></span></button></div></header>

			<h1 style={{"textAlign":"center"}}>Welcome to NextJs With Materialize Ui</h1>


			<h2 style={{"textAlign":"center"}}>Test Buttons</h2>


		       <Button variant="contained">Default</Button>
				<Button variant="contained" color="primary">
				  Primary
				</Button>
				<Button variant="contained" color="secondary">
				  Secondary
				</Button>
				<Button variant="contained" disabled>
				  Disabled
				</Button>
				<Button variant="contained" color="primary" href="#contained-buttons">
				  Link
				</Button>
		     

		     <br/><br/>

		     <h2 style={{"textAlign":"center"}}>Test XS GRID</h2>

		      <Grid container spacing={3}>
		        <Grid item xs={12}>
		          <span>Testandooo Grid</span>
		        </Grid>
		        <Grid item xs={6}>
		           <span>Testandooo Grid</span>
		        </Grid>
		        <Grid item xs={6}>
		            <span>Testandooo Grid</span>
		        </Grid>
		        <Grid item xs={3}>
		           <span>Testandooo Grid</span>
		        </Grid>
		        <Grid item xs={3}>
		           <span>Testandooo Grid</span>
		        </Grid>
		        <Grid item xs={3}>
		           <span>Testandooo Grid</span>
		        </Grid>
		        <Grid item xs={3}>
		           <span>Testandooo Grid</span>
		        </Grid>
		      </Grid>



		</div>
	);
}

export default Home
